import React, { Component } from 'react';
import Layout from '../../components/layout';


class ShopShow extends Component {

    static async getInitialProps(props) {
        const address = props.query.address;
        console.log(address);
        return {};
    }


    render() {
        return (
            <Layout>
                <h3>SHops</h3>
            </Layout>
        );
    }
}


export default ShopShow;
